import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { billers, BillingOperations } from "./components/BillingOperations";
import Transaction from "./components/Transaction";

const App = () => {
  return (
    <Router>
      <BillingOperations />
      <Routes>
        <Route path="/billing" element={<BillingOperations />} />
        <Route path="/billing/cignal" element={<Transaction />} />
        <Route path="/billing/converge" element={<Transaction />} />
        <Route path="/billing/home-credit" element={<Transaction />} />
        <Route path="/billing/maynilad" element={<Transaction />} />
        <Route path="/billing/meralco" element={<Transaction />} />
        <Route path="/billing/pag-ibig" element={<Transaction />} />
        <Route path="/billing/pldt" element={<Transaction />} />
        <Route path="/billing/prulife" element={<Transaction />} />
        <Route path="/billing/skycable" element={<Transaction />} />
        <Route path="/billing/sunlife" element={<Transaction />} />
        {/* Add more routes for other billers as needed */}
      </Routes>
    </Router>
  );
};

export default App;
